import {
    Chart,
    ChartSeries,
    ChartSeriesItem
} from '@progress/kendo-react-charts';

const seriesData = [
    6000,
    3000,
    1500,
    2250,
    1500,
    3000,
    2250,
    1500,
    2250,
    1500,
    2250,
    2250,
    4500,
    7500,
    4500
];

const ChartContainer = () => (
    <Chart>
        <ChartSeries>
            <ChartSeriesItem data={seriesData} />
        </ChartSeries>
    </Chart>
);

export default ChartContainer;
